#include "framework.hpp"


// This is a pseudocode of a SwiftUI-inspired GUI for C++

void widgetPlate(LayoutBuilder * builder, uint32_t recId)
{
    Rec & rec = builder.getRec(recId);
    builder.pushContainer("plateVBox");

    builder.pushContainer("titleHBox").withSpec(recId);
    builder.appendItem("titleLabel").withSpec(recId).withText(rec.text);
    builder.appendItem("HSpacer");
    builder.popContainer();

    for(size_t i = 0; i < rec.children.count(); i++)
    {
        Rec & recChild = builder.getRec(rec.children[i].id);

        builder.pushContainer("itemHBox").withSpec(rec.children[i].id);
        builder.appendItem("itemLabel").withSpec(rec.children[i].id).withText(recChild.text);
        builder.appendItem("HSpacer");
        builder.popContainer();
    }

    builder.popContainer();
}


void widgetRealm(LayoutBuilder * builder, uint32_t recId)
{
    Rec & rec = builder.getRec(recId);
    if(0 == rec.children.count())
        return;

    builder.pushContainer("realm");

    builder.build(widgetPlate).withSpec(recId);
    for(size_t i = 0; i < rec.children.count(); i++)
        builder.build(widgetRealm).withSpec(rec.children[i].id)

    builder.popContainer();
}


void widgetMain(LayoutBuilder * builder)
{
    builder.pushContainer("mainVbox");
    builder.build(widgetToolbar);
    builder.build(widgetRealm).withSpec(0);
    builder.pop();
}

int main()
{
    DataSource ds;
    AppContext appContext(ds);
    LayoutBuilder * layoutBuilder = appContext.getLayoutBuilder();
    widgetMain(layoutBuilder);

    appContext.style.push("#buttonNew/icon-image", "new.png");
    appContext.style.push("#buttonOpen/icon-image", "open.png");
    appContext.style.push("#buttonHelp/icon-image", "help.png");
    appContext.style.push(".itemLabel/color", "#88FFFFFF");
    appContext.style.push(".itemLabel/font", "arial/12");
    appContext.style.push(".titleLabel/color", "#88FFFFFF");
    appContext.style.push(".titleLabel/font", "verdana/12");
    appContext.style.push(".itemHbox/tint", "#88FFFFFF");
    appContext.style.push(".itemHbox:hover/tint", "#FFFFFFFF");
    appContext.style.push(".itemHbox/tint-animation", "linear/200");
    appContext.style.push(".titleHbox/tint", "#88FFFFFF");
    appContext.style.push(".titleHbox:hover/tint", "#FFFFFFFF");
    appContext.style.push(".titleHbox/tint-animation", "linear/200");

    appContext.run();
    return 0;
}

