#include <bits/stdc++.h>

using namespace std;

#define int long long

int32_t main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.tie(nullptr);

    int T;
    cin >> T;
    while(T--){
        int n, cost;
        cin >> n >> cost;

        vector<int> vec(n);
        for(int i = 0; i < n; i++)
            cin >> vec[i];

        int l = 0, r = 0, ans = 0, curr = 0;
        while(r < n){
            if(curr + vec[r] <= cost){
                curr += vec[r];
                r++;
            }else{
                if(l < r){
                    curr -= vec[l];
                    l++;
                }else{
                    l++, r++;
                }
            }
            ans = max(ans, curr);
        }

        cout << ans << endl;

    }
    return 0;
}

